에어컨이 처음에 작동이 잘 안되서 ㅠㅠ
근데 괜찮았습니다!
호텔에서 파는 떡볶이는 별로..ㅎㅎ;

화장실에 있는 거 말고,
개수대 물나오는 곳 전체적으로 점검 및 수리 하세요
준비 다 하고 체크아웃 하는 길.
손 씻으려고 물 틀었다가 물 나오는 입구가 뽑혀 봉변 당했네요 
아무리 취사 하지 않는다고해도 눈가리고 아웅;;
고장난 거 뻔히 들어나는데 꽂아놓기만 하다니;

생각보다 좁더라고요.. 
부모님 모시고 다녀왔는데 근처가 전부 모텔촌이라;;
그치만 시설도 깨끗하고 모든게 다 갖춰져있어서 좋았어여^^

새벽에는 옆방, 복도 말소리가 다 들려요..
깨끗하고 위치도 한옥마을 근처고 주차장도 있고 다 좋은데 방음이 정말;;;;; 
그리고 큰 타올에 구멍나있었.. 음ㅋㅋ
